import { instance } from "./axios.util"

export const onPasswordUpdate=(object)=>{
    return instance({
        url:'/user/password',
        method:'patch',
        data:object
    })
}

export const getTradeSellChart=(seller)=>{
    return instance({
        url:'/tradeinfo/sellchart'+seller,
        method:'get'
    })
}

axios.get(`/api/tradeinfo/sellchart/${seller}`)
